import Signup from "./signup/Signup";
import "./App.css";
import { createBrowserRouter } from "react-router-dom";

function App() {
  const route = createBrowserRouter([
    {
      path: "/signup",
      element: <Signup />,
    },
  ]);

  return (
    <div className="App">
      <Signup />
    </div>
  );
}

export default App;
